import { Injectable } from '@angular/core';
import axios from 'axios';

@Injectable({
  providedIn: 'root'
})
export class ServiceService {
data:any;
  constructor() { }

public getUsers() {
  this.data =  axios.get('http://localhost:9000/api/users')
  .then(response => {
    // Handle the response data here
    console.log(response.data);
  })
  .catch(error => {
    // Handle any errors here
    console.error(error);
  });

  return this.data;
  }

}
